import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import CreateProperty from './CreateProperty';

function Navbar() {
  const [showProperties, setShowProperties] = useState(false);
  const [showAddProperty, setShowAddProperty] = useState(false);
  const [showAuth, setShowAuth] = useState(false);

  return (
    <nav style={{ display: 'flex', justifyContent: 'space-between' }}>
      <div>
        <button onClick={() => setShowProperties(!showProperties)}>
          Properties
        </button>
        {showProperties && (
          <div className="properties-dropdown">
            <Link to="/properties">View All</Link>
          </div>
        )}
      </div>

      <div>
        <button onClick={() => setShowAddProperty(!showAddProperty)}>
          Add Property
        </button>
        {showAddProperty && (
          <div className="add-property-form">
            <CreateProperty />
          </div>
        )}
      </div>

      <div>
        <button onClick={() => setShowAuth(!showAuth)}>
          Login/Signup
        </button>
        {showAuth && (
          <div className="auth-form">
            {/* Auth form will go here */}
          </div>
        )}
      </div>
    </nav>
  );
}

export default Navbar;
